Got7 (갓세븐; estilizado como GOT7), es un septeto musical formado por JYP Entertainment  en 2014. El grupo está compuesto por: Mark, JB, Jackson, JinYoung, Youngjae, BamBam y  Yugyeom. Got7 debutó con el miniálbum Got it?. El grupo ganó atención por sus representaciones teatrales, que incluyen elementos de artes marciales.

A finales de 2014, Got7 firmó con Sony Music Entertainment Japan y se aventuró en el mercado japonés para lanzar su primer single"Around the World". Regresaron a Corea del Sur un mes después para lanzar su primer álbum de estudio, Identify, el cual encabezó varias listas del país. En 2015, Got7 lanzó los EP, Just Right y MadJust. En 2016, lanzaron su primer álbum de estudio japonés, Moriagatteyo, el cual debutó en el tercer puesto de Oricon Albums Chart. Luego lanzaron su quinto miniálbum coreano, Flight Log: Departure y su segundo álbum de estudio Flight Log: Turbulence, los cuales fueron un éxito en Gaon.

